import React from "react";

const TableHead = props => {
  //console.log(props);

  const RenderNameornot = () => {
      if(props.columns.label) return(props.columns.label);
      else return null;
  };
  const { columns } = props;
  return (
    <>
      <thead className="table-dark">
        <tr>
          {columns.map(it => {
            return <th key={it.label || it.key}>{RenderNameornot()}</th>;
          })}
        </tr>
      </thead>
    </>
  );
};

export default TableHead;
